  dbClickScreen(e) {
    var y;
    var x;

    x = e.offsetX || e.layerX;
    y = e.offsetY || e.layerY;

    // return tile x,y that we clicked
    var cell =
      [
        Math.floor(y/32),
        Math.floor(x/32)
      ];

    // now we know while tile we clicked
    console.log('we clicked tile '+cell[0]+','+cell[1]);
  }
